import React, { Component } from "react";
import "./App.css";

export const Start = (props) => {
    return(
        <Grid>
            <p>Welcome to Auto Insurance! Lets get started</p>
            <Grid.Column floated="left" width={5}>
            </Grid.Column>
            <Grid.Column floated="right" width={5}>
                <Button primary onClick={() => props.next(states.PERSONAL_DETAILS_FORM)}>Next</Button>
            </Grid.Column>
        </Grid>
    );
}
